import React from 'react';

export default function ParkImages(props) {
  console.log(props.images[0].url);
  return props.images.map((image) => {
    return (
      <div>
        <img src={image.url} alt={image.title}></img>
        <p>{image.url}</p>
      </div>
    );
  });
}
